(1000001, 'Jim OU', 'Jim OU, the one who create this demo'),
(1000003, 'Ran Ran', 'Ran Ran. One of the most naughty and lovely girl in the world :P'),
(1000004, '马云', '男，1964年9月10日生于浙江省杭州市，祖籍浙江省嵊州市（原嵊县）谷来镇， 阿里巴巴集团主要创始人，现担任阿里巴巴集团董事局主席、日本软银董事、大自然保护协会中国理事会主席兼全球董事会成员、华谊兄弟董事、生命科学突破奖基金会董事。\n1988年毕业于杭州师范学院外语系，同年担任杭州电子工业学院英文及国际贸易教师，1995年创办中国第一家互联网商业信息发布网站“中国黄页”，1998年出任中国国际电子商务中心国富通信息技术发展有限公司总经理，1999年创办阿里巴巴，并担任阿里集团CEO、董事局主席。\n2013年5月10日，辞任阿里巴巴集团CEO，继续担任阿里集团董事局主席。6月30日，马云当选全球互联网治理联盟理事会联合主席。10月受邀出任英国首相戴维·卡梅伦的特别经济事务顾问。 2016年5月8日，马云任中国企业家俱乐部主席。\n2017年10月28日，马云在个人微博上公布了一张电影海报，并配以大有深意的“那一夜，那一梦”六个字，证实参演影片《功守道》。\n2017年11月16日，2017福布斯中国富豪榜公布，以2554.3亿元财富，排名第三位 。同年12月15日，荣获“影响中国”2017年度教育人物 。\n2018年1月17日，阿里巴巴集团董事局主席马云以个人名义向团结香港基金捐赠5000万港元，以支持教育、青年、创新等领域的政策研究和相关工作。'),
(1000005, '马化腾', '男，1971年10月29日生于广东省汕头市潮南区。腾讯公司主要创办人之一。现任腾讯公司控股董事会主席兼首席执行官；全国青联副主席。\r\n马化腾曾在深圳大学主修计算机及应用，于1993年取得深大理科学士学位。在创办腾讯之前，马化腾曾在中国电信服务和产品供应商深圳润迅通讯发展有限公司主管互联网传呼系统的研究开发工作，在电信及互联网行业拥有10多年经验。\r\n1998年，马化腾和好友张志东注册成立"深圳市腾讯计算机系统有限公司"。2009年，腾讯入选《财富》“全球最受尊敬50家公司”。\r\n2017年8月7日，腾讯股价盘中再创历史新高价320.6港元，马化腾身家361亿美元成为中国首富。'),
(1000006, '欧阳雪源', '男，1971年出生，江西省新干县人。中国科学技术大学少年班86级无线电专业高材生。曾任TCL电脑研发中心副经理、十二年信息安全企业CEO，双百灵语音健康管理手机创始人、设计师。\r\n1999年，欧阳雪源G类发明“一种解决微机跨越2000年世纪过渡问题的方法”专利，作为一种硬件解决方案解决了千年虫问题，获得了前所未有的轰动。\r\n千年虫又被称为计算机2000年问题、电脑千禧年千年虫问题、千年病毒、2000年病毒。是指在某些使用了计算机程序的智能系统（包括计算机系统、自动控制芯片等）中，由于其中的年份只使用两位十进制数来表示，因此当系统进行（或涉及到）跨世纪的日期处理运算时（如多个日期之间的计算或比较等），就会出现错误的结果，进而引发各种各样的系统功能紊乱甚至崩溃。\r\n千年虫影响很大，从计算机系统包括PC机的BIOS、微码到操作系统、数据库软件、商用软件和应用系统等，到与计算机和自动控制有关的电话程控交换机、银行自动取款机、保安系统、工厂自动化系统等，乃至使用了嵌入式芯片技术的大量的电子电器、机械设备和控制系统，等等，都有可能受到“千年虫”的攻击。西非国家冈比亚成为全球首个受千年虫严重影响的国家，除不少地方电力供应中断外，海空交通、金融和政府服务亦大受影响，其中财政部、税局和海关更因而无法运作。'),
(1000017, '李彦宏', '百度公司创始人、董事长兼首席执行官，全面负责百度公司的战略规划和运营管理。\r\n1991年，李彦宏毕业于北京大学信息管理专业，随后前往美国布法罗纽约州立大学完成计算机科学硕士学位，先后担任道·琼斯公司高级顾问、《华尔街日报》网络版实时金融信息系统设计者，以及国际知名互联网企业——Infoseek公司资深工程师。李彦宏所持有的“超链分析”技术专利，是奠定整个现代搜索引擎发展趋势和方向的基础发明之一。\r\n2000年1月，李彦宏创建了百度。经过十多年的发展，百度已经发展成为全球第二大独立搜索引擎和最大的中文搜索引擎。百度的成功，也使中国成为美国、俄罗斯和韩国之外，全球仅有的4个拥有搜索引擎核心技术的国家之一。2005年，百度在美国纳斯达克成功上市，并成为首家进入纳斯达克成分股的中国公司。百度已经成为中国最具价值的品牌之一。\r\n2013年，当选第十二届全国政协委员，兼任中国民间商会副会长，第十一届中华全国工商业联合会副主席、第八届北京市科协副主席等职务，并获聘“国家特聘专家”。\r\n2018年1月19日，出版的《时代》周刊刊发了对百度公司董事长兼首席执行官李彦宏的专访。并且李彦宏以“the innovator（创新者）”的称谓，成为了本期亚洲版的封面人物。这是中国互联网企业家第一次登上时代周刊封面。'),
(1000021, '雷军', '雷军，1969年12月出生于湖北仙桃，毕业于武汉大学，是中国大陆著名天使投资人。 [1]   雷军作为中国互联网代表人物及全球年度电子商务创新领袖人物 [1]  ，曾获中国经济年度人物及十大财智领袖人物、中国互联网年度人物 [2]  等多项国内外荣誉，并当选《福布斯》（亚洲版）2014年度商业人物。同时兼任金山、YY、猎豹移动等三家上市公司董事长。雷军曾任两届海淀区政协委员，2012年当选北京市人大代表，2013年2月当选全国人民代表大会代表。2017年12月，荣获2017“质量之光”年度质量人物奖。 [3]   现任第十二届全国人大代表，全国工商联副主席，北京市工商联副主席，小米科技有限责任公司董事长兼首席执行官，北京金山软件有限公司董事长。 [4]  2017十大经济年度人物。 [5]  北京市出席第十三届全国人民代表大会代表。'),
(1000022, '刘强东', '刘强东， [1]  京东集团董事局主席兼执行官， [2]  祖籍湖南湘潭 [3]  ，1974年2月14日出生于江苏省宿迁市 [4]  ，本科毕业于中国人民大学，民建会员。 [5]  河北省阜平县平石头村名誉村长。 [6]   1998年6月18日，在中关村创办京东公司，代理销售光磁产品，并担任总经理 [7]  。2004年，初涉足电子商务领域，创办“京东多媒体网”（京东商城的前身），并出任CEO。目前，京东商城已成为中国最大的自营式电商企业 [1]  ，而京东集团的业务也从电子商务扩展至金融、技术领域，拥有近12万名正式员工 [8]  ，跻身全球前十大互联网公司排行榜 [9]  。2014年5月，京东在美国纳斯达克成功上市 [10]  。 [11-13]  2012年，入选《财富》（中文版）2012年"中国40位40岁以下的商界精英"榜单，并位居榜首。2014年，刘强东以530亿元人民币的财富位列《胡润百富榜》第九 [14]  。2015年，入选《财富》“全球50位最伟大的领导者” [15]  。同年，位列《财富》（中文版）“中国最具影响力的50位商界领袖”第11位 [16]  ；获得《公益时报》发起的2015年中国慈善榜 “十大慈善家”称号 [17]  。2016年胡润百富榜，刘强东以455亿财富排名第26位。 [18]  2016胡润IT富豪榜，刘强东以420亿元排名第7。 [19]  2016福布斯中国富豪榜，刘强东排名第16位。 [20]  2016年获中国社会责任杰出人物奖 [21]  。政协第十三届全国委员会提案委员会委员。'),
(1000023, '丁磊', '丁磊，男，1971年10月1日生于浙江省宁波市。网易公司创始人，现担任网易公司董事局主席兼首席执行官。 1993年本科毕业于电子科技大学，1997年5月创立网易公司，与张朝阳、王志东并称为网络三剑客。2000年6月，网易在纳斯达克正式挂牌上市。2009年，宣布网易养猪计划。2015年2月11日，入选“2014中国互联网年度人物”。 [1]  2015年10月26日，以75亿美元的财富位列《2015年福布斯中国富豪榜》第十。 [2]  2016年2月24日，丁磊 财富630亿元新进《2016胡润全球富豪榜》大陆前十名，位列第十，全球第121位，比2015年上升30位。 [3]  10月13日，2016年胡润百富榜发布，丁磊以1000亿元财富，位列第六名。 [4]  10月18日，《2016胡润IT富豪榜》发布，丁磊以960亿元排名第三。 [5]  10月27日，2016福布斯中国富豪榜公布，丁磊以152亿美元财富，排名第五位。 [6]'),
(1000024, '张朝阳', '张朝阳，1964年10月31日出生在陕西省西安市，搜狐公司董事局主席兼首席执行官。1986年毕业于清华大学物理系，并于同年考取李政道奖学金赴美留学。1993年在麻省理工学院获得博士学位后，在麻省理工学院继续博士后研究。1996年8月手持风险资金，回国创建了爱特信公司，公司于1998年正式推出其品牌网站搜狐网，同时更名为搜狐公司。 2015年，为大鹏电影《煎饼侠》而客串搜狐公司CEO，同时也作为本片的制作人。 [1]   2017年11月9日，搜狗正式在美国纽交所上市，张朝阳及王小川敲响纽交所开市钟。'),
(1000025, 'Michael Lin', 'Head of HTC HUB core banking');

